objetoCompra:
Curso referente a treinamento de brigada de incêndio tipo 1, para 9 (nove) participantes;
Sendo o grupo formando pelo quadro de funcionário do conselho, conforme da norma técnica do corpo de Bombeiro do estado de Mato Grosso nº 34
NTCB 34 conteúdo programático para o curso de formação de brigadista:
O curso deve contemplar treinamento de prevenção e combate a incêndio;
Com utilização de equipamentos de combate a incêndio;
Primeiros socorros inclusos material didático com certificado de participação.
